    console.log(allAuthors)
    let authorsList = []
    allAuthors.forEach(author => {
      authorsList.push(
        <div className="author-card">
          <h2> test</h2>
          {/* <img src={author.picture.url} alt='author' /> */}
        </div>
      )
        console.log(authorsList)
    })
    return (
      {authorsList}
    )
  }
}
